import React from 'react';
import { Button } from '@mui/material';

export default function InputButton(props) {
  return (
    <Button
      variant="contained"
      fullWidth
      sx={{
        bgcolor: 'gray',
        marginTop: '30px',
        fontFamily: 'Montserrat',
        borderRadius: '50px',
      }}
    >
      {props.name}
    </Button>
  );
}
